INSERT INTO `pregunta` VALUES (1,'Créditos complementarios','Debe acreditar mínimamente dos (2) créditos de formación complementaria, los cuales puede desarrollarlo mediante talleres: Deportivos, Artísticos, Tutoría par, Responsabilidad social, etc.',1),(2,'Justificación de inasistencias','El estudiante podrá justificar inasistencias por razones médicas, fallecimiento de familiares, citación judicial o representación institucional. Debe presentar su solicitud en el campus virtual con documentos sustentatorios, dentro de los 2 días hábiles posteriores a la inasistencia.',2),(3,'Retiro de semestre académico','Es voluntario, autorizado por la Dirección de Escuela y no permite retiro parcial. Se solicita por motivos personales, familiares, económicos o de salud. Se debe hacer mediante el campus virtual con documentos sustentatorios.',3),(4,'Retiro definitivo','Se solicita a través del módulo virtual. Si es durante el semestre, implica también retiro del semestre. Puede anularse con trámite dentro de 5 días. Si desea continuar estudios en semestres posteriores, tiene hasta 2 años para solicitar reincorporación.',3),(5,'Reserva de matrícula','Permite diferir la matrícula por un semestre. Se solicita con sustento a través del campus virtual en fechas definidas. No debe exceder 3 años. Para movilidad académica saliente, se realiza automáticamente.',4),(6,'Reincorporación','Solicitada por estudiantes que dejaron de matricularse sin reservar. Se pide a través del campus virtual, está sujeta a vacantes y calendario. No se autoriza si fue separado por razones académicas o disciplinarias.',4),(7,'Cursos de verano','Depende de la programación de la Escuela. Debe ser consultado en una base de datos externa o actualizada mediante app web.',5),(8,'Prácticas preprofesionales','Se deben completar 260 horas a partir del VIII ciclo, sin cursos pendientes de ciclos anteriores. Se solicita carta de presentación por campus virtual.',6),(9,'Cambio de tema de tesis','Se realiza por caso fortuito o fuerza mayor, aprobado por el asesor. Debe presentarse informe y nuevo proyecto. Si se aprueba, se reinicia el proceso según el reglamento de tesis.',7),(10,'Actualización de datos de tesis','Si se requiere mejorar redacción de título, objetivos, etc., se debe hacer el trámite virtual para que lo atienda el Docente de Apoyo a Tesis.',7),(11,'Obtención del grado de bachiller','Requiere condición de egresado, no tener deudas, pago de trámite, haber llevado curso de investigación y cumplir los requisitos administrativos.',8),(12,'Sustentación de tesis','Requiere grado de bachiller, conformidad del asesor, no tener deudas y pago de derecho de sustentación.',8),(13,'Titulación','Requiere grado de bachiller, aprobación de tesis ante jurado, no tener deudas, pago por título y cumplimiento de requisitos administrativos.',8),(14,'Idioma inglés','Es requisito de egreso. Se debe acreditar nivel intermedio (B1).',8),(15,'Programa de actualización de tesis','Dirigido a egresados o bachilleres con tesis desactualizadas. Consta de tres fases: proyecto, ejecución e informe. Cada fase tiene su propio trámite y documentación.',7),(16,'Vigencia del proyecto de tesis aprobado','El proyecto tiene vigencia de 3 años desde la aprobación. Puede ampliarse 1 año más como excepción. Luego de ese plazo, pierde validez y se debe presentar uno nuevo.',7),(17,'Director de Escuela','Ing. Huilder Mera\r\nCorreo hmera.@usat.edu.pe',10);
/*!40000 ALTER TABLE `pregunta` ENABLE KEYS */;
UNLOCK TABLES;

